const Course = ({course}) => {
  return (
    <>
    <h1>{course.name}</h1>
    </>
  )
}

const App = () => {
  const course = {
    id: 1,
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return (
    <div>
    <Course course={course} />
    <ul>
      {course.parts.map(cou => cou.name)}
    </ul>
    </div>
  )
}

export default App
